import React, { Component, useState } from "react";
import { NavLink } from "react-router-dom";
import style from "./Nav.module.css";

export default function Nav() {
  return (
    <nav className={style.sideNav}>
      <ul>
        <li>Home</li>
        <li>Projects</li>
        <li>Digital Media</li>
        <li>About</li>
      </ul>
    </nav>
  );
}
